function setupAutoRemoveImages() {
    const AD_SELECTORS = [
        'ut1_img',
        '.ut1_img_content',
        '.ut1_img utactivity',
        '.ut1_img_content_js',
        '.ut1_img_ex_content',
        '.di_img',
        '.di_100',
        '[class^="mvspan"]'
    ].join(',');
    // ‰ΩøÁî®Èò≤ÊäñÂáΩÊï∞‰ºòÂåñÈ´òÈ¢ëDOMÊìç‰Ωú
    let cleanupTimer;
    const debouncedRemove = () => {
        clearTimeout(cleanupTimer);
        cleanupTimer = setTimeout(removeAllImages, 200);
    };
    const removeAllImages = () => { document.querySelectorAll(AD_SELECTORS).forEach(img => img.remove()); };
//forEachÊñπÊ≥ïÁöÑÂõûË∞ÉÂáΩÊï∞ÊòØË°®ËææÂºèÔºå‰∏çÊòØËØ≠Âè•Ôºå‰∏çËÉΩÂä†ÂàÜÂè∑„ÄÇ

    const observer = new MutationObserver(mutations => {
        // ÂèòÂåñÊúâÊïàÊÄßÊ£ÄÊü•
        const hasValidMutation = mutations.some(mutation =>
            mutation.type === 'childList' &&
            mutation.addedNodes.length > 0
        );

        if (hasValidMutation) {
            debouncedRemove();
        }
    });

    // ÁõëÂê¨
    const observerConfig = {
        childList: true,
        subtree: true
        // Â§áÁî®attributes: true
    };

    // ÂàùÂßãÂåñÁ´ãÂç≥ÊâßË°å‰∏ÄÊ¨°Ê∏ÖÁêÜ
    removeAllImages();

    // ÂêØÂä®ËßÇÂØü
    observer.observe(document.body, observerConfig);

    window.addEventListener('error', e => {
        console.error('ÂπøÂëäÊ∏ÖÁêÜÂá∫Èîô:', e.error);
        observer.disconnect();
    });
}

// Ëá™Âä®ÈáçËØïÊú∫Âà∂
let retryCount = 0;
function init() {
    try {
        setupAutoRemoveImages();
    } catch (e) {
